script: |
  super -f text -I q7922.spq | sort > q7922.out

inputs:
  - name: q7922.spq
    data: |
      SELECT DISTINCT MIN ( DISTINCT + - col0 ) AS col1 FROM tab0 (FORMAT parquet) WHERE - - ( - ( - col0 ) ) * + col0 + + - col2 + - + col2 * + 18 IS NOT NULL;
  - name: tab0

outputs:
  - name: q7922.out
    data: |
      -97
